// Input: multiple items
// Output: only the first item with extra column "id" = 1

const items = $input.all();

// take the first item
const first = items[0];

// add new field "id" = 1
first.json.id = "1";

// return it as array
return [first];

// n8n Code node - return only the FIRST item (cleaned)
// Input: items array from previous node
// Output: single item [{ json: <first item's cleaned json> }]

function unquoteString(s) {
  if (typeof s !== 'string') return s;
  // remove surrounding quotes (single or double), including repeated ones
  let out = s.replace(/^"+|"+$/g, '').replace(/^'+|'+$/g, '');
  // unescape any escaped quotes inside (\" -> ")
  out = out.replace(/\\"/g, '"').replace(/\\'/g, "'");
  return out;
}

function deepClean(obj) {
  if (obj === null || obj === undefined) return obj;
  if (Array.isArray(obj)) {
    return obj.map(deepClean);
  } else if (typeof obj === 'object') {
    const res = {};
    for (const k of Object.keys(obj)) {
      res[k] = deepClean(obj[k]);
    }
    return res;
  } else if (typeof obj === 'string') {
    // trim and unquote
    const trimmed = obj.trim();
    return unquoteString(trimmed);
  } else {
    return obj;
  }
}

// If no items, return empty array (n8n expects array of items)
if (!items || items.length === 0) {
  return [];
}

// take the first item
const first = items[0].json || {};

// clean it (removes extra wrapper-quotes from string fields)
const cleaned = deepClean(first);

// return a single item only
return [{ json: cleaned }];

// Force exactly ONE item into the next node.
// We'll pull case_id from your Edit Fields node (stable source).
const caseId = $('Edit Fields12').first().json["case_id"];

// Return a single item only
return [
  {
    json: { case_id: caseId }
  }
];

