// Input: items[i].json.section3.clean_html  (fallback: items[i].json.clean_html)
// Output: ONLY { clean_html: <balanced html> } per item, when present

function balanceHtml(html) {
  if (typeof html !== "string") return "";

  let src = html
    .replace(/\r/g, "")
    .replace(/[\t ]+\n/g, "\n")
    .replace(/\n{3,}/g, "\n\n")
    .trim();

  const VOID = new Set([
    "area","base","br","col","embed","hr","img","input",
    "link","meta","param","source","track","wbr"
  ]);

  const TAG_RE = /<\/?([a-zA-Z0-9]+)(\s[^>]*)?>/g;

  let out = "";
  let lastIndex = 0;
  const stack = [];
  const lc = (s) => (s || "").toLowerCase();
  const isSelfClosingSyntax = (tagName, rawTag) =>
    /\/\s*>$/.test(rawTag) || VOID.has(lc(tagName));

  let m;
  while ((m = TAG_RE.exec(src)) !== null) {
    const full = m[0];
    const tagName = lc(m[1] || "");
    const isClosing = full.startsWith("</");
    out += src.slice(lastIndex, m.index);
    lastIndex = TAG_RE.lastIndex;

    if (!tagName) { out += full; continue; }

    if (isClosing) {
      if (VOID.has(tagName)) continue;
      let idx = stack.length - 1;
      while (idx >= 0 && stack[idx] !== tagName) idx--;
      if (idx === -1) continue;
      for (let j = stack.length - 1; j >= idx; j--) out += `</${stack[j]}>`;
      stack.length = idx;
    } else {
      if (isSelfClosingSyntax(tagName, full)) {
        out += full.replace(/\s+\/>/, "/>").replace(/>$/, ">");
      } else {
        stack.push(tagName);
        out += full;
      }
    }
  }

  out += src.slice(lastIndex);
  for (let i = stack.length - 1; i >= 0; i--) out += `</${stack[i]}>`;

  out = out.replace(/>\s+</g, "><").replace(/(\s){2,}/g, " ");
  return out.trim();
}

return items
  .map(item => {
    const j = item.json || {};
    const htmlIn = j?.section3?.clean_html ?? j?.clean_html ?? "";
    const fixed = balanceHtml(htmlIn);
    return fixed ? { json: { clean_html: fixed } } : null;
  })
  .filter(x => x !== null); // <-- keep only non-empty clean_html items

